":1.3059902507827779,\"width\":85.9504132231405,\"height\":97.94926880870834,\"action\":{\"library\":\"H5P.DragText 1.10\",\"params\":{\"media\":{\"disableImageZooming\":false},\"taskDescription\":\"<p>Arrastrar las palabras a las cajas correctas</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"checkAnswer\":\"Comprobar\",\"submitAnswer\":\"Enviar\",\"tryAgain\":\"Reintentar\",\"showSolution\":\"Mostrar solución\",\"dropZoneIndex\":\"Zona de colocación @index.\",\"empty\":\"La zona de Colocación @index está vacía.\",\"contains\":\"La zona de Colocación @index contiene elemento @draggable.\",\"ariaDraggableIndex\":\"@index de @count elementos que se pueden colocar.\",\"tipLabel\":\"Mostrar pista\",\"correctText\":\"¡Correcto!\",\"incorrectText\":\"¡Incorrecto!\",\"resetDropTitle\":\"Restablecer colocación\",\"resetDropDescription\":\"¿Seguro que quieres restablecer esta zona de colocación?\",\"grabbed\":\"El arrastrable está agarrado.\",\"cancelledDragging\":\"Arrastre cancelado.\",\"correctAnswer\":\"Respuesta correcta:\",\"feedbackHeader\":\"Retroalimentación\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"Obtuvo :num de un total de :total puntos\",\"a11yCheck\":\"Comprobar las respuestas. Las respuestas serán marcadas como correcta, incorrecta o sin contestar.\",\"a11yShowSolution\":\"Mostrar la solución. El trabajo será calificado con su solución correcta.\",\"a11yRetry\":\"Reintentar el trabajo. Reiniciar todas las respuestas e iniciar el trabajo de nuevo.\",\"textField\":\"La enseñanza de habilidades blandas en STEM se logra mediante estrategias que combinan el desarrollo técnico y socioemocional. El *aprendizaje basado en proyectos:Diseña actividades donde los estudiantes resuelvan problemas reales, desarrollando creatividad y pensamiento crítico al plantear soluciones prácticas\\\\+¡Correcto!* permite resolver desafíos reales, mientras el *trabajo colaborativo:Promueve dinámicas en las que los estudiantes trabajen en equipo\\\\+¡Correcto!* fomenta la comunicación. En estos contextos, la *resolución de conflictos:Incluye actividades grupales en las que los estudiantes enfrenten diferencias, practicando la negociación y el respeto mutuo para alcanzar acuerdos\\\\+¡Correcto!* se aborda como una oportunidad para practicar empatía. Asimismo, al concluir las actividades, se debe *fomentar la reflexión:Guía a los estudiantes a analizar sus aprendizajes, identificando cómo aplicaron habilidades interpersonales y STEM.\\\\+¡Correcto!* para identificar aprendizajes y áreas de mejora. Finalmente, el *uso de tecnología:Incorpora herramientas digitales para la gestión de proyectos, simulaciones y colaboración en línea\\\\+¡Correcto!* potencia tanto las competencias STEM como las interpersonales, preparando a los estudiantes para retos complejos.\"},\"subContentId\":\"ed9f9413-5419-4371-a24d-376e6b0b2544\",\"metadata\":{\"contentType\":\"Arrastra las palabras (Drag the Words)\",\"license\":\"U\",\"title\":\"Arrastra las palabras\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Arrastra las palabras\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[],\"slideBackgroundSelector\":{}}],\"keywordListEnabled\":true,\"globalBackgroundSelector\":{},\"keywordListAlwaysShow\":false,\"keywordListAutoHide\":false,\"keywordListOpacity\":90},\"override\":{\"activeSurface\":false,\"hideSummarySlide\":false,\"summarySlideSolutionButton\":true,\"summarySlideRetryButton\":true,\"enablePrintButton\":false,\"social\":{\"showFacebookShare\":false,\"facebookShare\":{\"url\":\"@currentpageurl\",\"quote\":\"Obtuve @score de @maxScore en un trabajo en @currentpageurl.\"},\"showTwitterShare\":false,\"twitterShare\":{\"statement\":\"Obtuve @score de @maxScore en un trabajo en @currentpageurl.\",\"url\":\"@currentpage
